import "../NavBar/Navbar.css";

import { Link } from "react-router-dom";
import React from "react";

function NavBar(props)
{
  function logout(){
    props.logout();
  }

  return<div className="nav">
    <Link style={{"textDecoration":"none"}} to={'/'}>
        <h1 className="appName">BUY NOW</h1>
    </Link>
  <div className="routes">
      {/* <i>
          <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20" fill="currentColor" className="bi bi-bell" viewBox="0 0 16 16">
              
          </svg>
      </i> */}
      <Link to={'/profile'}>
      <span className="username">
          {props.name}
      </span>
      </Link>
      <div className="logout">
          <i color="black">

          <svg onClick={logout} xmlns="http://www.w3.org/2000/svg" width="20" height="20" fill="currentColor" className="bi bi-box-arrow-right" viewBox="0 0 16 16">
  <path fillRule="evenodd" d="M10 12.5a.5.5 0 0 1-.5.5h-8a.5.5 0 0 1-.5-.5v-9a.5.5 0 0 1 .5-.5h8a.5.5 0 0 1 .5.5v2a.5.5 0 0 0 1 0v-2A1.5 1.5 0 0 0 9.5 2h-8A1.5 1.5 0 0 0 0 3.5v9A1.5 1.5 0 0 0 1.5 14h8a1.5 1.5 0 0 0 1.5-1.5v-2a.5.5 0 0 0-1 0v2z"/>
  <path fillRule="evenodd" d="M15.854 8.354a.5.5 0 0 0 0-.708l-3-3a.5.5 0 0 0-.708.708L14.293 7.5H5.5a.5.5 0 0 0 0 1h8.793l-2.147 2.146a.5.5 0 0 0 .708.708l3-3z"/>
</svg>
          </i>
      </div>
  </div>
</div>
};

export default NavBar;
